    }

    protected override async Task OnInitializedAsync()
    {
        var spotify = builder.BuildClient();

        var albumRequest = new ArtistsAlbumsRequest
        {
            Limit = 8
        };
        albums = await spotify.Result.Artists.GetAlbums(Constants.ARTIST_ID, albumRequest);

    }

